import React from "react";
import data from "./CheerWorlds.json";
import CheerWorldsItem from "./CheerWorldsItem";

const CheerWorlds = () => {
  return (
    <div className="table-responsive">
      <table className="table table-hover">
        <thead>
          <tr>
            <th scope="col">Gym Name</th>
            <th scope="col">Team name</th>
            <th scope="col">Division</th>
            <th scope="col">Type of bid</th>
            <th scope="col">Bid provider</th>
            <th scope="col">Team Instagram</th>
            <th scope="col">Gym Instagram</th>
          </tr>
        </thead>
        <CheerWorldsItem worldsTeams={data} />
      </table>
    </div>
  );
};

export default CheerWorlds;
